public static int retrieveOpenCounterWithMostSnrs(Supermarket supermarket) {
    int counterNum = -1;
    double percentage = 0.0;

    for(int i = 1; i <= supermarket.getNumCounters(); i++){
        Counter c = supermarket.getCounter(i);
        if(c != null){
            int numSeniors = 0;
            for(int j = 1; j <= c.getNumCustomersInQueue(); j++){
                Customer cus = c.getCustomerAtPosition(j);
                if(cus.getAge() >= 60){
                    numSeniors++;
                }
            }
            double curPercentage = (double)numSeniors / c.getNumCustomersInQueue();
            if(curPercentage > percentage){
                counterNum = i;
                percentage = curPercentage;
            }
        }
    }

    return counterNum;
}

