public static String printPattern(String word, char ch){
    if(word == null){
        return "";
    }
    StringBuilder sb = new StringBuilder();
    for(int i = 0; i < word.length(); i++){
        char c = word.charAt(i);
        sb.append(c);
        if(i != word.length() - 1){
            sb.append(ch);
        }
    }
    return sb.toString();
}

