public static void printCheckerBoard(String input, int row, int col){
    for(int i = 0; i < row; i++){
        for(int j = 0; j < col; j++){
            if((i+j) % 2 == 0){
                printStars(input);
            } else{
                System.out.print(input);
            }
        }
        if(i != row - 1){
            System.out.println("");
        }
    }
}

private static void printStars(String input){
    for(int i = 0; i < input.length(); i++){
        System.out.print("*");
    }
}

