public static int retrieveOpenCounterWithMostSnrs(Supermarket supermarket) {
    int toReturn = -1;
    double percentage = 0;

    for (int i = 1; i <= supermarket.getNumCounters(); i++) {
        Counter counter = supermarket.getCounter(i);
        int snr = 0;
        for (int j = 1; j <= counter.getNumCustomersInQueue(); j++) {
            Customer customer = counter.getCustomerAtPosition(j);
            if (customer.getAge() >= 60) {
                snr++;
            }
        }
        double currentPercentage = (double) snr / counter.getNumCustomersInQueue();
        if (currentPercentage > percentage) {
            percentage = currentPercentage;
            toReturn = counter.getId();
        }
    }
    return toReturn;
}

