        int len = word.length();
        String starStr = "";
        for (int j = 0; j < len; j++) {
            starStr += "*";
        }
        if (i % 2 == 0) {
            for (int j = 0; j < c; j++) {
                if (j % 2 == 0) {
                    System.out.print(starStr);    
                }
                else {
                    System.out.print(word);
                }
            } 
        }
        else {
            for (int j = 0; j < c; j++) {
                if (j % 2 == 0) {
                    System.out.print(word);    
                }
                else {
                    System.out.print(starStr);
                }
            }  
        }
        System.out.println();
    }
}

