public static String printPattern(String word, char ch){
    if (word == null || word.length() == 0){
        return "";
    }
    String output = "";
    output += word.charAt(0);
    for (int i = 1; i < word.length(); i++){
        output += ch;
        output += word.charAt(i);
    }

    return output;
}

