public static void flippedTriangle(int height){

    for (int i = 1; i <= height; i++){

        for(int empty = i; empty < height; empty++){
            System.out.print(" ");
        }
        for (int ast = i; ast > 0; ast-- ){
            System.out.print("*");
        }
        System.out.println();


    }



}

